// src/components/AdminOrders.js
import React, { useEffect, useState } from "react";
import api from "../axiosInstance";

export default function AdminOrders() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchAllOrders = async () => {
    try {
      const token = localStorage.getItem("token");
      if (!token) {
        alert("You need to be logged in as an admin to view this page.");
        return;
      }

      const response = await api.get("/Orders/all", {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (response.status === 200) {
        setOrders(response.data);
      }
    } catch (error) {
      console.error("Failed to fetch orders:", error);
      alert(
        error.response?.data?.message ||
          "An error occurred while fetching orders."
      );
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchAllOrders();
  }, []);

  const updateOrderStatus = async (orderId, newStatus) => {
    try {
      const token = localStorage.getItem("token");
      if (!token) {
        alert("You need to be logged in as an admin to perform this action.");
        return;
      }

      const response = await api.put(
        `/Orders/${orderId}/status`,
        { status: newStatus },
        {
          headers: { Authorization: `Bearer ${token}` },
        }
      );

      if (response.status === 200) {
        alert("Order status updated successfully.");
        // Update the local state to reflect the change
        setOrders((prevOrders) =>
          prevOrders.map((order) =>
            order.id === orderId ? { ...order, status: newStatus } : order
          )
        );
      }
    } catch (error) {
      console.error("Failed to update order status:", error);
      alert(
        error.response?.data?.message ||
          "An error occurred while updating order status."
      );
    }
  };

  if (loading) return <div className="text-center mt-8">Loading...</div>;

  if (orders.length === 0)
    return <div className="text-center mt-8">No orders found.</div>;

  return (
    <section className="orders-section mt-8 max-w-7xl mx-auto">
      <h1 className="text-center text-primary text-4xl mb-6">All Orders</h1>
      {orders.map((order) => (
        <div
          key={order.id}
          className="order bg-white p-6 rounded shadow-md mb-6"
        >
          <h2 className="text-2xl font-semibold mb-4">Order ID: {order.id}</h2>
          <p className="mb-2">
            <strong>User ID:</strong> {order.userId}
          </p>
          <p className="mb-2">
            <strong>Status:</strong> {order.status}
          </p>
          <p className="mb-4">
            <strong>Created At:</strong>{" "}
            {new Date(order.createdAt).toLocaleString()}
          </p>
          {/* Display order items as before */}
          <p className="text-xl font-semibold">
            Total Amount: ${order.totalAmount.toFixed(2)}
          </p>
          <div className="mt-4">
            <label htmlFor={`status-${order.id}`} className="mr-2">
              Update Status:
            </label>
            <select
              id={`status-${order.id}`}
              value={order.status}
              onChange={(e) => updateOrderStatus(order.id, e.target.value)}
              className="border border-gray-300 rounded px-2 py-1"
            >
              <option value="Pending">Pending</option>
              <option value="Processing">Processing</option>
              <option value="Completed">Completed</option>
              <option value="Cancelled">Cancelled</option>
            </select>
          </div>
        </div>
      ))}
    </section>
  );
}
